import React, { useState } from "react";
import NavBar from "../home/NavBar";

import Form from "../home/Form";
import Footer from "../home/Footer";

const dataNavbarMenu = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const dataFooter = [
  {
    col_number: 1,
    col_values: [
      "Countries",
      "Regions",
      "Cities",
      "Districts",
      "Airports",
      "Hotels",
    ],
  },
  {
    col_number: 2,
    col_values: [
      "Homes",
      "Apartments",
      "Resorts",
      "Villas",
      "Hostels",
      "Guest houses",
    ],
  },
  {
    col_number: 3,
    col_values: [
      "Unique places to stay",
      "Reviews",
      "Unpacked: Travel articles",
      "Travel communities",
      "Seasonal and holiday deals",
    ],
  },
  {
    col_number: 4,
    col_values: [
      "Car rental",
      "Flight Finder",
      "Restaurant reservations",
      "Travel Agents",
    ],
  },
  {
    col_number: 5,
    col_values: [
      "Curtomer Service",
      "Partner Help",
      "Careers",
      "Sustainability",
      "Press center",
      "Safety Resource Center",
      "Investor relations",
      "Terms & conditions",
    ],
  },
];

const Detail = (props) => {
  return (
    <>
      <div className="container bg-blue">
        <NavBar dataNavbarMenu={dataNavbarMenu} />
      </div>

      {/* <div className="container">
        <Body dataCity={dataCity} dataType={dataType} dataHotel={dataHotel} />
      </div> */}
      <div className="container bg-blue">
        <Form />
      </div>
      <div className="container">
        <Footer dataFooter={dataFooter} />
      </div>
    </>
  );
};

export default Detail;

